import React from 'react';
import Cards from './Cards';
import Sdata from './Sdata';

function CardInfra() {

    function mydata(val){
        return (
            <Cards imgSrc= {Sdata[0].imgSrc} 
            title={Sdata[0].title} 
            sname={Sdata[0].sname} 
            link={Sdata[0].link}
            />
        )
    }

    return(
        <>       
        <h1 className="heading_style">Top list of Netflix Series</h1>
        <div className="contentWrapper">
            <Cards imgSrc= {Sdata[0].imgSrc} 
            title={Sdata[0].title} 
            sname={Sdata[0].sname} 
            link={Sdata[0].link}
            />
            <Cards imgSrc= {Sdata[1].imgSrc} 
            title={Sdata[1].title} 
            sname={Sdata[1].sname} 
            link={Sdata[1].link}
            />
            <Cards imgSrc= {Sdata[2].imgSrc} 
            title={Sdata[2].title} 
            sname={Sdata[2].sname} 
            link={Sdata[2].link}
            />
            </div>
        <div className="contentWrapper">  
            <Cards imgSrc= {Sdata[3].imgSrc} 
            title={Sdata[3].title} 
            sname={Sdata[3].sname} 
            link={Sdata[3].link}
            />
            <Cards imgSrc= {Sdata[4].imgSrc} 
            title={Sdata[4].title} 
            sname={Sdata[4].sname} 
            link={Sdata[4].link}
            />
            <Cards imgSrc= {Sdata[5].imgSrc} 
            title={Sdata[5].title} 
            sname={Sdata[5].sname} 
            link={Sdata[5].link}
            />
        </div> 

        {Sdata.map(mydata)}

        </>
    )
} export default CardInfra;
